import styled from "styled-components";

export const Home = styled.div`
    border: solid black;
    width: 100%;
    
    a{
    color: black;
    font-size: 1.5rem;
    text-decoration: none;
    transition: 1s all;
    
        &:hover{
            transform: scale(1.2);
        }
    }   
`
